import "./App.scss";
import { 
  Footer, 
  getNavItems, 
  Header, 
  Navbar, 
  Main, 
} from "../components";

function App() {
  return (
    <div className="App">
      <Header />
      <Navbar navItems={getNavItems()} />
      <Main />
      <Footer />
    </div>
  );
}

export default App;
